import { Component, OnInit } from '@angular/core';

import { FormControl } from '@angular/forms';
import { HttpClient } from '@angular/common/http';

import { /*map, startWith, */debounceTime, tap, switchMap, finalize, debounce } from 'rxjs/operators';
//import { Observable } from 'rxjs';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit {
  title = 'marshall-llc-web-app';
  formControl = new FormControl();
  //autoFilter: Observable<string[]> | undefined;
  autoFilter: any;
  isLoading = false;
  errorMsg: string | undefined;
  public serviceResponse: ServiceResponse | undefined;
  constructor(private http: HttpClient){}

  ngOnInit(){
    this.formControl.valueChanges
    .pipe(
      debounceTime(500),
      tap(() => {
        this.errorMsg = "";
        this.autoFilter = [];
        this.isLoading = true;
      }),
      switchMap(value => this.http.get<ServiceResponse>("https://localhost:44350/Employee/Get/0/" + value + "?PageNumber=1&PageSize=10")
        .pipe(
          finalize(() => {
            this.isLoading = false
          }),
        )
      )
    )
    .subscribe(data => {
      this.serviceResponse = data;
      if (this.serviceResponse.validationResult.isValid){
        this.autoFilter = this.serviceResponse.data;
        this.errorMsg = this.serviceResponse.validationResult.errors[0].message;
      } else {
        this.autoFilter = [];
        this.errorMsg = "";
      }
      /*
      if (data['Search'] == undefined){
        this.errorMsg= data['Error'];
        this.autoFilter = [];
      } else {
        this.errorMsg = "";
        this.autoFilter = data["Search"];
      }*/
      console.log(this.autoFilter);
    })
  }
/*
  private mat_filter(value: string): string[]{
    const filterValue = this.mat_normalizeValue(value);
    return this.Items.filter(street => this.mat_normalizeValue(street).includes(filterValue));
  }

  private mat_normalizeValue(value: string): string {
    return value.toLowerCase().replace(/\s/g, '');
  }*/
}
interface ServiceResponse {
  data: Employee[];
  validationResult: Validation;
  pageNumber: number,
  pageSize: number,
  firstPage: string,
  lastPage: string,
  totalPages: number,
  totalRecords: number,
  nextPage: string,
  previousPage: string
}
interface Validation {
  isValid: boolean;
  errors: Errors[];
}
interface Errors {
  message: string;
}
interface Employee {
  id: number;
  employeeCode: string;
  employeeName: string;
  employeeSurname: string;
  birthday: string;
  identificationNumber: number;
}
